export default function Times() {
    
    return (
    <div>
        <div>
            <img src="/assets/clock.png" alt="this is a clock"/>
            <p>Service Times</p>
        </div>
        <div>
            <p>Sundays: 10:30am</p>
            <p>Wednesdays: 7pm</p>
        </div>
    </div>
    );
}
